import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './App.css';
import VideoThumb from './VideoThumb';

var apiKey = "AIzaSyAqxjnnG7Sfva9oHu4Btuosrehfl5l_Qwo";
var playlistID = "PLPFcHFmFMXEDatE2hyXFz0iC8TMeo7xmL";
var URL = `https://www.googleapis.com/youtube/v3/playlistItems?part=snippet&playlistId=${playlistID}&key=${apiKey}`;

function App() {
  const [videos, setVideos] = useState([]);
  const [showing, setShowing] = useState(false)

  useEffect(() => {
    axios.get(URL).then((response) => {
      setVideos(response.data.items);
    })
  }, [])

  const handleClick = (e) => {
    setShowing(!showing);
  }

  console.log(videos);

  return (
    <div className='App'>;
      <div className='dashboard-video-container'>
     {videos.map((video, key) => {
      return <div key={video.id} className='video-container'>
        <img src={video.snippet.thumbnails.medium.url} alt={video.snippet.title}/>
        <h3>{video.snippet.title}</h3>
      </div>
     })}
     </div>
    </div>
  )
}  
export default App;
